When you die, you appear in a cinema with a number of other people who look like you. You find out that they are your previous reincarnations, and soon you all begin watching your next life on the big screen. "It's dark in here," said the version of you sitting next to you. They continued, "I'm not sure if I want to watch this." The other person next to you agreed. "Yeah, I threw up the first time I watched something." You all sat in silence for a while, watching the screen. What you see first is your childhood. They look like you and the memories are very familiar, but some slight variations of what you remember. You ask your companions, "Why are we watching this?" And the person on the right said , "It's so we can learn from our mistakes and not make them again." You did not reply and continued to watch in silence.

There were so bad memories you rather not watch. The time when you were in the fourth grade and you were so shy that you didn't want to go to school because you were afraid that you would be teased. The time when you were a fourteen year old and you were so afraid of your parents that you ran away from home. And when you were twenty-two and it was the first time you were in love and you were so afraid of being rejected that you didn't tell the person how you felt.

But you also saw yourself succeed. Despite all your challenges, the version of you you;

